import React from 'react'

const Test2 = ({data}) => {
    return (
        <div>
            {
                data.map((data1)=>{
                    const {id,age,name}=data1
                    return(
                       <div>
                         <h1>{id}</h1>
                        <h1>{name}</h1>
                       </div>
                    )
                })
            }
        
        </div>
      )
 
}

export default Test2
